import './PortfolioGrid.css';
import PortfolioCard from './PortfolioCard.js';

function PortfolioGrid () {
    return (
        <div class="PortfolioContainer">
        <div class="ViewMore">View More</div>
        <div class="PortfolioGrid">
            <PortfolioCard projectName="Lexicon DS" />
            <PortfolioCard projectName="Error Pages" />
            <PortfolioCard projectName="Lima Team" />
            <PortfolioCard projectName="Empty States" />
        </div>
        </div>
    )
}

export default PortfolioGrid;
